import React, { useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import { FiShoppingCart, FiMenu, FiX, FiUser } from 'react-icons/fi';
import { AuthContext } from '../Context/AuthContext';

const Navbar = ({ isAuthenticated }) => {
  const [sidePanelOpen, setSidePanelOpen] = useState(false);
  const { user, logout } = useContext(AuthContext);

  return (
    <nav className="bg-white text-gray-800 px-6 py-4 flex justify-between items-center shadow-lg rounded-b-2xl animate-fadeIn border-b border-gray-200">
      <Link to="/" className="text-2xl font-extrabold tracking-wide drop-shadow-lg hover:text-yellow-600 transition-colors duration-200">Food Delivery</Link>

      {/* Desktop Nav */}
      <div className="hidden md:flex gap-4 items-center">
        <Link to="/products" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold">Products</Link>
        <Link to="/cart" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold flex items-center gap-2">
          <FiShoppingCart className="text-xl" /> Cart
        </Link>
        <Link to="/orders" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold">Orders</Link>
        {isAuthenticated ? (
          <>
            <Link to="/profile" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold flex items-center gap-2">
              <FiUser className="text-xl" />
              {user?.name || 'Profile'}
            </Link>
            <button onClick={logout} className="ml-2 px-4 py-2 bg-red-100 text-red-700 rounded-xl shadow hover:bg-red-200 transition-all duration-200 font-semibold">Logout</button>
          </>
        ) : (
          <>
            <Link to="/login" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold">Login</Link>
            <Link to="/signup" className="px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold">Signup</Link>
          </>
        )}
      </div>

      {/* Mobile Nav */}
      <button className="md:hidden text-2xl p-2 rounded hover:bg-yellow-100 transition" onClick={() => setSidePanelOpen(true)} aria-label="Open menu">
        <FiMenu />
      </button>

      {/* Side Panel */}
      {sidePanelOpen && (
        <div className="fixed inset-0 z-50 bg-black bg-opacity-30 flex justify-end">
          <div className="w-64 bg-white h-full shadow-lg flex flex-col p-6 animate-slideIn">
            <button className="self-end text-2xl mb-6 text-gray-600 hover:text-red-500" onClick={() => setSidePanelOpen(false)} aria-label="Close menu">
              <FiX />
            </button>
            <Link to="/products" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold" onClick={() => setSidePanelOpen(false)}>Products</Link>
            <Link to="/cart" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold flex items-center gap-2" onClick={() => setSidePanelOpen(false)}>
              <FiShoppingCart className="text-xl" /> Cart
            </Link>
            <Link to="/orders" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold" onClick={() => setSidePanelOpen(false)}>Orders</Link>
            {isAuthenticated ? (
              <>
                <Link to="/profile" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold flex items-center gap-2" onClick={() => setSidePanelOpen(false)}>
                  <FiUser className="text-xl" />
                  {user?.name || 'Profile'}
                </Link>
                <button onClick={() => { window.location.href = '/login'; setSidePanelOpen(false); }} className="mb-4 px-4 py-2 bg-red-100 text-red-700 rounded-xl shadow hover:bg-red-200 transition-all duration-200 font-semibold">Logout</button>
              </>
            ) : (
              <>
                <Link to="/login" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold" onClick={() => setSidePanelOpen(false)}>Login</Link>
                <Link to="/signup" className="mb-4 px-3 py-2 rounded-xl hover:bg-yellow-100 hover:text-yellow-700 transition-all duration-200 font-semibold" onClick={() => setSidePanelOpen(false)}>Signup</Link>
              </>
            )}
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
